import React, {useState, useEffect} from 'react';
import '../App.css';

function Events() {

  useEffect(() => {
    fetchEvents();
  }, []);

  const fetchEvents = async () => {
    const data = await fetch(
      'http://localhost:3000/standford-events-rss.xml'
    );
    console.log(data);
  };




  return (
    <div className="App">
      <h1>Events</h1>
    </div>
  );
}

export default Events;
